describe("getCanvasData (method)",()=>{it("should get an empty object when it is not ready",()=>{const e=window.createImage(),t=new Cropper(e).getCanvasData();expect(t).to.be.an("object").that.is.empty}),it("should get expect canvas data when ready",e=>{const t=window.createImage(),a=new Cropper(t,{ready(){const t=a.getCanvasData();expect(t).to.be.an("object").that.has.all.keys(["left","top","width","height","naturalWidth","naturalHeight"]),expect(t.left).to.be.a("number"),expect(t.top).to.be.a("number"),expect(t.width).to.be.a("number"),expect(t.height).to.be.a("number"),expect(t.naturalWidth).to.be.a("number"),expect(t.naturalHeight).to.be.a("number"),e()}})})});